import React from 'react';
import 'Homepage.css';

const Homepage = () => {
  return (
    <div classname='header1'>
      <h1 idname='topheader'>Worrying about your car in parking?</h1>
      <p>Say no more!</p>
      <p> Track your car as you go along!</p>
    </div>
  );
};

export default Homepage;
